import './navigation.css'

function Nav()
{
    let title='Oceas Blush'
    return(
        <div className="mainNav">
            <div className="left">
                <p>{title}</p>
            </div>
            <div className="right">
                <ul>
                    <li> <a href="/">Home</a></li>
                    <li> <a href="/">About</a></li>
                    <li> <a href="/">Contact</a></li>
                </ul>
            </div>
        </div>
    );
}
export default Nav
